import { Link, useParams } from 'react-router-dom';
import { GrFormPrevious } from 'react-icons/gr';

const CommentGoBack = () => {
	const { id } = useParams();
	return (
		<div className="commentGoBack">
			<Link to={`/blogs/${id}`}>
				<GrFormPrevious />
				Back to Blog
			</Link>
		</div>
	);
};

export default CommentGoBack;
